DELIMITER $$
CREATE TRIGGER  roles_before_insert
    BEFORE INSERT ON roles
    FOR EACH ROW
    BEGIN
        SET NEW.id=UUID();
    END $$
DELIMITER ;


DELIMITER $$
CREATE TRIGGER  users_before_insert
    BEFORE INSERT ON users
    FOR EACH ROW
    BEGIN
        SET NEW.id=UUID();
    END $$
DELIMITER ;





SELECT
    u.id AS user_id,
    r.id AS role_id
FROM
    users u
JOIN
    roles r
ORDER BY
    RAND()
LIMIT 1000;
